import React from 'react'
import {useLocation, useParams} from 'react-router-dom'

const CartScreen = () => {
    const {id} = useParams()
    const location = useLocation()
    console.log(location.search)
    return (
        <div>
            Cart id:{id}
        </div>
    )
}

export default CartScreen
